import React from 'react';

const Home = () => {
  return (
    <>
      <header>
        <a href="">Logo</a>
        <nav>
          <ul>
            <li>Home</li>
            <li>About</li>
            <li>Contact</li>
          </ul>
        </nav>
      </header>
    </>
  );
};

export default Home;
